package db.domain;import java.util.Arrays;public class UserBagImpl implements UserBag {	@Key	private String uname;	private int capacity;	public UserBagImpl() {	}	public UserBagImpl(UserBag c) {		this.uname = c.getUname();		this.capacity = c.getCapacity();	}	@Override	public String tableName() {		return "user_bag";	}	public void setUname(String uname) {		this.uname = uname;	}	public String getUname() {		return this.uname;	}public void addUname(String uname) {		this.uname += uname;}	public void setCapacity(int capacity) {		this.capacity = capacity;	}	public int getCapacity() {		return this.capacity;	}public void addCapacity(int capacity) {		this.capacity += capacity;}}